@namespace url(http://www.w3.org/1999/xhtml);
* { color: #bdbbbb !important; background: #171717 !important; border-color: #4e4e4e !important; text-shadow: none !important; }
a, a * { color: #92f210 !important; text-decoration: none !important; }
a:visited, a:visited * { color: #0497ff !important; }
a:hover, a:hover * { color: #ecd803 !important;  background: #1b1b1b !important; }
